---
schema: |+
  definition user {}

  caveat only_on_tuesday(day_of_week string) {
    day_of_week == 'tuesday'
  }

  definition document {
  	relation writer: user
  	relation reader: user with only_on_tuesday
    permission write = writer
    permission view = reader + write
  }

